import React, { Component } from 'react';

class Music extends Component {
  render() {
    return (
      <div className='container'>
        <div className='row'>
          <div className='col-12 text-center'>
            <div>
              <h2>Music Page </h2>
              <h2>*work in progress*</h2>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default Music;
